function  init_paginator_listcontentdrupalnotes(a, b, c) {

    a = a, lcdnitemsPorPagina = b, lcdnnumerosPorPagina = 8
}

//<li class="'.$state.'"><img src="backend/'.$item["ruta"].'" alt="Navigation avatar" data-target="#carousel-drupalnotes" data-slide-to="'.$row.'" class="img-fluid img-circle"></li>

function creaPaginadorlistcontentdrupalnotes(a) {
    paginadorlistcontentdrupalnotes.html(""),
        lcdntotalPaginas = Math.ceil(a / lcdnitemsPorPagina),
        $('<li><a href="#" class="lcdn_first_link"><</a></li>').appendTo(paginadorlistcontentdrupalnotes),
        $('<li><a href="#" class="lcdn_prev_link">«</a></li>').appendTo(paginadorlistcontentdrupalnotes);

    //solo pinta los li a mostrar
    for (var b = 0; lcdntotalPaginas > b;) {
        $('<li><a href="#" class="lcdn_page_link" data-target="#carousel-drupalnotes" data-slide-to="'+b+'">' + (b + 1) + "</a></li>").appendTo(paginadorlistcontentdrupalnotes), b++;
    }
    lcdnnumerosPorPagina > 1 && ($(".lcdn_page_link").hide(),

        $(".lcdn_page_link").slice(0, lcdnnumerosPorPagina).show()),
        $('<li><a href="#" class="lcdn_next_link">»</a></li>').appendTo(paginadorlistcontentdrupalnotes),
        $('<li><a href="#" class="lcdn_last_link">></a></li>').appendTo(paginadorlistcontentdrupalnotes),

    0 == lcdnpagina && (paginadorlistcontentdrupalnotes.find(".lcdn_page_link:first").addClass("active"),
        paginadorlistcontentdrupalnotes.find(".lcdn_page_link:first").parents("li").addClass("active")),
        paginadorlistcontentdrupalnotes.find(".lcdn_prev_link").hide(),

        paginadorlistcontentdrupalnotes.find("li .lcdn_page_link").click(function() {
            var a = $(this).html().valueOf() - 1;
            return cargaPaginalistcontentdrupalnotes(a), !1
        }), paginadorlistcontentdrupalnotes.find("li .lcdn_first_link").click(function() {
        var a = 0;
        return cargaPaginalistcontentdrupalnotes(a), !1
    }), paginadorlistcontentdrupalnotes.find("li .lcdn_prev_link").click(function() {
        var a = parseInt(paginadorlistcontentdrupalnotes.data("pag")) - 1;
        return cargaPaginalistcontentdrupalnotes(a), !1
    }), paginadorlistcontentdrupalnotes.find("li .lcdn_next_link").click(function() {
        var a = parseInt(paginadorlistcontentdrupalnotes.data("pag")) + 1;
        return cargaPaginalistcontentdrupalnotes(a), !1
    }), paginadorlistcontentdrupalnotes.find("li .lcdn_last_link").click(function() {
        var a = lcdntotalPaginas - 1;
        return cargaPaginalistcontentdrupalnotes(a), !1
    })
}

function get_datalcdn() {
    cosole.log("nada")
}

function set_callbacklistcontentdrupalnotes(a) {
    ! function(b) {
        b.get_datalcdn = function() {
            a()
        }
    }(window || {})
}

function cargaPaginalistcontentdrupalnotes(a) {

    $(".flistcontentdrupalnotes").css('left', -8200);
    $(".flistcontentdrupalnotes").animate({left: '50%'});

    lcdnpagina = a,
        lcdndesde = lcdnpagina * lcdnitemsPorPagina, get_datalcdn(),
        lcdnpagina >= 1 ? paginadorlistcontentdrupalnotes.find(".lcdn_prev_link").show() : paginadorlistcontentdrupalnotes.find(".lcdn_prev_link").hide(),
        lcdntotalPaginas - lcdnnumerosPorPagina > lcdnpagina ? paginadorlistcontentdrupalnotes.find(".lcdn_next_link").show() : paginadorlistcontentdrupalnotes.find(".lcdn_next_link").hide(),
        paginadorlistcontentdrupalnotes.data("pag", lcdnpagina),
    lcdnnumerosPorPagina > 1 && ($(".lcdn_page_link").hide(), lcdntotalPaginas - lcdnnumerosPorPagina > lcdnpagina ? $(".lcdn_page_link").slice(lcdnpagina, lcdnnumerosPorPagina + lcdnpagina).show() : lcdntotalPaginas > lcdnnumerosPorPagina ? $(".lcdn_page_link").slice(lcdntotalPaginas - lcdnnumerosPorPagina).show() : $(".lcdn_page_link").slice(0).show()),
        paginadorlistcontentdrupalnotes.children().removeClass("active"), paginadorlistcontentdrupalnotes.children().eq(lcdnpagina + 2).addClass("active")

}
var paginadorlistcontentdrupalnotes, lcdntotalPaginas, lcdnitemsPorPagina = 4,
    lcdnnumerosPorPagina = 4,
    lcdndesde = 0,
    lcdnpagina = 0;